import { VideoList } from "./components/VideoList";

const videos = [
  {
    name: "video of me",
    duration: "15 min",
    id: 1,
  },
  {
    name: "video my ",
    duration: "5 min",
    id: 2,
  },
];

function App() {
  return (
    <div>
      {videos.map((video) => (
        <div key={video.id}>
          <p>
            hello guys, i'm gonna show you:
            {video.duration} - {video.name}
          </p>
        </div>
      ))}
      <VideoList />
    </div>
  );
}

export default App;
